class Evaluate extends React.Component {
  state = {
    isRichard: "",
  };

  render() {
    let answer = "";
    //console.log(this.props.case);

    if (this.state.isRichard === "") {
      answer = <div></div>;
    } else if (this.state.isRichard === "true") {
      answer = <div>You most likely have it...</div>;
    } else if (this.state.isRichard === "false") {
      answer = <div> Na, you are fine!</div>;
    }

    return (
      <div>
        <select
          onChange={(e) => this.setState({ isRichard: e.target.value })}
          className="form-control"
        >
          <option value="">Please select</option>
          <option value="true"><strong>Is your name Richard T?</strong></option>
          <option value="false">Other</option>
        </select>

        <br />
        <div className="text-center">
          <h4>
            <strong>{answer}</strong>
          </h4>
        </div>
      </div>
    );
  }
}

export default Evaluate;
